import React, { useEffect, useState } from 'react'

function Test() {

    const [counter, setCounter] = useState(0);

    useEffect(() => {
        document.title = `${counter} times`;
    }, [])

    return (
        <div>
            <div>you clikced {counter} times</div>
            <button onClick={() => setCounter(counter + 1)}>Click me</button>
        </div>
    )
}

export default Test
